DROP TABLE  INVOKE_RELATION;
CREATE TABLE  INVOKE_RELATION  ( 
	ID              	INTEGER NOT NULL,
	SERVICE_ID      	VARCHAR(255) NOT NULL,
	OPERATION_ID    	VARCHAR(255) NOT NULL,
	ECODE           	VARCHAR(255) NOT NULL,
	PROVIDE_SYS_ID  	VARCHAR(255) NOT NULL,
	CONSUME_SYS_ID  	VARCHAR(255),
	PASSBY_SYS_ID   	VARCHAR(255),
	CONSUME_MSG_TYPE	VARCHAR(4),
	PROVIDE_MSG_TYPE	VARCHAR(4),
	MODIFYUSER      	VARCHAR(50),
	UPDATETIME      	TIMESTAMP,
	FUNCTYPE        	VARCHAR(50),
	SVCHEADER       	VARCHAR(25),
	THROUGH         	VARCHAR(10),
	DIRECTION       	VARCHAR(2) 
	)
;
COMMENT ON TABLE  INVOKE_RELATION IS '调用关系表'
;
COMMENT ON COLUMN  INVOKE_RELATION.ID IS '主键ID'
;
COMMENT ON COLUMN  INVOKE_RELATION.SERVICE_ID IS '服务ID'
;
COMMENT ON COLUMN  INVOKE_RELATION.OPERATION_ID IS '操作ID'
;
COMMENT ON COLUMN  INVOKE_RELATION.ECODE IS '交易代码'
;
COMMENT ON COLUMN  INVOKE_RELATION.PROVIDE_SYS_ID IS '提供方系统ID'
;
COMMENT ON COLUMN  INVOKE_RELATION.CONSUME_SYS_ID IS '调用系统ID'
;
COMMENT ON COLUMN  INVOKE_RELATION.PASSBY_SYS_ID IS '经由系统ID'
;
COMMENT ON COLUMN  INVOKE_RELATION.CONSUME_MSG_TYPE IS '调用报文类型'
;
COMMENT ON COLUMN  INVOKE_RELATION.PROVIDE_MSG_TYPE IS '提供报文类型'
;
COMMENT ON COLUMN  INVOKE_RELATION.MODIFYUSER IS '更新用户'
;
COMMENT ON COLUMN  INVOKE_RELATION.UPDATETIME IS '更新时间'
;
COMMENT ON COLUMN  INVOKE_RELATION.FUNCTYPE IS '功能划分'
;
COMMENT ON COLUMN  INVOKE_RELATION.SVCHEADER IS '业务报文头'
;
COMMENT ON COLUMN  INVOKE_RELATION.THROUGH IS '是否穿透'
;
COMMENT ON COLUMN  INVOKE_RELATION.DIRECTION IS '接口方向'
;
